import React from 'react';
import { Button, Linking, RefreshControl, ScrollView, StyleSheet, Text, View } from 'react-native';
import { useState } from 'react';

const Home = (props)=>{
  return(

    <View>

      <Text style={{fontSize:40,margin:10,alignContent:'center',flex:1,textAlign:'center'}} >
      Home Activity
      {props.Data}
      </Text>


    </View>
  )
}

export default Home;
